import '../C_dashboard/style_dashboard.css';
import React from 'react';



function profile(props) {
  
  return (    
    <div class="profile">      
        {props.userprofile_path}
         <img src={require(this.props.userprofile_path)} className="user_profile" alt="icon" /><br></br>
         <div class="user_about">{props.userprofile_about}</div><br></br>
         <div class="user_school">{props.user_school}</div><br></br>
         <div class="user_degree">{props.user_degree}</div><br></br>
    </div>  
  );
}

export default profile;
